import connection from "../config/dbconfig";

export const getPlayerRaid = async (req, res) => {
    connection.query("SELECT * FROM player_raids", (err, rows) => {
        if(err) throw err;
        return res.status(200).json({
            data: rows,
            success: true,
            message: "Success"
        })
